INSERT INTO Recipe (recipe_id, title, subtitle, servings, yield_unit, prep_min, cook_min, stnd_min, source, intro, directions) VALUES (484, 'Fresh Mushroom Soup', NULL, 4, NULL, 10, 15, 0, 'The American Mushroom Institute', 'An easy to make soup that''s great for a light lunch or dinner starter.', 'Slice caps and stems of mushrooms in thick pieces. Heat oil in a heavy saucepan and saute the mushrooms quickly until just crisp tender. Combine all other ingredients in blender and mix until thick and foamy. Add mushrooms and blend again at lowest speed for 4-5 seconds or until mushrooms are chopped into fine pieces but not pulverized. Pour mixture back into the saucepan and heat slowly, stirring with a wire whisk to keep from burning.');
