INSERT INTO Recipe (recipe_id, title, subtitle, servings, yield_unit, prep_min, cook_min, stnd_min, source, intro, directions) VALUES (422, 'Spicy Cranberry and Peach Salad Mold', NULL, 8, NULL, 5, 15, 120, 'The Wisconsin Department of Agriculture', 'A Thanksgiving alternative.', replace('Drain peaches, reserving juice. Measure juice and add water to make 1 1/2 cups liquid in all. Combine with the sugar, vinegar, and spices. Bring to a boil and simmer 5 minutes. Add sliced peaches and simmer 5 minutes longer. Remove peaches and spices from syrup. Measure syrup and add boiling water\nto make 2 1/2 cups in all. Dissolve the gelatin in this. Add the cold water. Cool. Chill until the consistency of heavy syrup. Break the canned cranberry sauce into small chunks with a fork. Add the peaches and cranberries to the gelatin. Turn into a 10" x 6" cakepan. Chill until firm. Cut into squares and serve on lettuce.','\n',char(10)));

